which will send GraphQL request to the server and return the response back. The GraphQL is helpful because it can send a batch of requests together and get the custom fields. Given we have a GraphQL request mutation resetBooking { bookingReset } # retrieve booking mutation retrieveBooking { bookingRetrieve(request: { recordLocator: "YDZDRF" firstName: "test" lastName: "test" }) { bookingKey breakdown{balanceDue} } } 5/17/2018 [DotRez API] Using GraphQL - NextGen Booking Engine Home - Jetstar Wiki https://jetstar.jira.com/wiki/spaces/NGBE/pages/308510821/DotRez+API+Using+GraphQL 2/16 Then we can send with request body. You can find that the GraphQL scripts are put into query field by escaping. And we can get the response. You can find that all the responses are organized by the name of the request. How to test GraphQL scripts in browser? Get the tool 1. Download the code from github: git clone git@github.com:beretverde/graphiql- browser.git 2. Open the index.html 3. Input the base url to the input field and click Go button. "query": "mutation resetBooking {
  bookingReset
}

# retrieve booking
mutation "variables": "null", "operationName": "retrieveBooking" } "data": { "resetBooking": { "bookingReset": true }, "retrieveBooking": { "bookingRetrieve": { "bookingKey": "MTQ5OTkwOTA5IVlEWkRSRiFmYWxzZQ--", "breakdown": { "balanceDue": 0 } } } }, "metadata": { "documentation_url": "http://developer.navitaire.com/documentation/dotrezapi/gr } } 5/17/2018 [DotRez API] Using GraphQL - NextGen Booking Engine Home - Jetstar Wiki https://jetstar.jira.com/wiki/spaces/NGBE/pages/308510821/DotRez+API+Using+GraphQL 3/16 Script Part The left half is the script part. You can input any script there, syntax check is always enabled so you can see if the script is valid or not "#" is used as comment meanning, you can use " ctrl + / " to comment lines. By using " ctrl + space ", you can get hint. this is very helpful, such as, you can get which field should fill. Response Part The right half is the response part. When you finished the script, and passed syntax check, you can click ▶  button to run the script, then the response will show in the right panel. If multiple script are executed, the response will include all of them. Document part In the right there is a button < Docs, By clicking it you will see the search field. The document here is very useful. You can find the way of a route: query or mutation, specificaation of request field, or the route is stateful or stateless. How to add GraphQL route by extending dotRez API? There are 2 steps to add new route: Using attribute GraphRoute to define a GraphQL route Register the class to StartupModule. The sample code: 5/17/2018 [DotRez API] Using GraphQL - NextGen Booking Engine Home - Jetstar Wiki https://jetstar.jira.com/wiki/spaces/NGBE/pages/308510821/DotRez+API+Using+GraphQL 4/16 How to write dotREZ-API GraphQL script? It follows the standard GraphQL syntax. CustomGraphRoutes.class using GraphQL.SchemaGenerator.Attributes; using System.ComponentModel; using Navitaire.DotRez.Core.Services; using Navitaire.DotRez.Nsk.Booking.Models.Availability; using Navitaire.DotRez.Nsk.Booking.ServiceModels.Interfaces.v3; namespace Api_Custom_Endpoints.Routes public class CustomGraphRoutes { private IAvailabilityServiceModelv3 MyAvailabilityServiceModelv3 { get; } private IValidationService MyValidationService { get; } public CustomGraphRoutes(IAvailabilityServiceModelv3 myAvailabilityServiceM { MyAvailabilityServiceModelv3 = myAvailabilityServiceModelv3; MyValidationService = myValidationService; } [Description(@"Custom graphQL endpoint: Availability search")] [GraphRoute("abcTest", IsMutation = true)] public Availability AvailabilitySearch(AvailabilityRequest request) { MyValidationService.Validate(request); return MyAvailabilityServiceModelv3.Searchv3(request); } } } Register graph route public override void ConfigureServices(IServiceCollection services) base.ConfigureServices(services); //Register the graph route. services.AddSingleton<CustomGraphRoutes>(); } 5/17/2018 [DotRez API] Using GraphQL - NextGen Booking Engine Home - Jetstar Wiki https://jetstar.jira.com/wiki/spaces/NGBE/pages/308510821/DotRez+API+Using+GraphQL 5/16 The most simple script is like this: The two types of operation: query and mutation. Generally speaking, query is used to query and do not change the data, mapping to GET in REST API; mutation is used to change data, mapping to POST, PUT, DELETE, PATCH in REST API. operation-name is a name you can define to mark the script. route-name is the GraphQL routes defined in the server. Some tested GraphQL scripts operation-type operation-name{route-name([param-key: param-value]*){response-proper # clear session and booking state mutation resetBooking { bookingReset } # query trip query queryTrip { availabilitySimplev2(request: {origin: "SYD", destination: "MEL", beginDate: "03- currencyCode includeTaxesAndFees trips { journeysAvailable { flightType journeyKey notForGeneralUser stops fares { key value { availableCount classOfService fareKey: fareAvailabilityKey fareCode isSumOfSector } } } } } } 5/17/2018 [DotRez API] Using GraphQL - NextGen Booking Engine Home - Jetstar Wiki https://jetstar.jira.com/wiki/spaces/NGBE/pages/308510821/DotRez+API+Using+GraphQL 6/16 # sell a trip mutation tripSell{tripAdd(request: keys: { journeyKey:"SlF_IDUwMH4gfn5NRUx_MDQvMDMvMjAxOCAwNjowNX5TWUR_MDQvMDMvMjAxOCAwNzo fareAvailabilityKey:"MH5PUH5_SlF_T0xFQ09PUH40MDAxfn4wfjF_flg-" }, currencyCode:"AUD", passengers: { types: { type:"ADT", count:1 }, residentCountry:"US" } }) { journeys{ segments{ identifier{ carrierCode } cabinOfService fares{ classOfService fareBasisCode } } } }} # add a passenger mutation addPassengers{passengerSet(passengerKey:"MCFBRFQ-",request:{ name:{ first:"Testing", middle:"D", last:"Booking" }, info:{ dateOfBirth:"1995/01/01", gender:Male, nationality:"US", residentCountry:"US" } }) { 5/17/2018 [DotRez API] Using GraphQL - NextGen Booking Engine Home - Jetstar Wiki https://jetstar.jira.com/wiki/spaces/NGBE/pages/308510821/DotRez+API+Using+GraphQL 7/16 customerNumber discountCode passengerAlternateKey passengerKey passengerTypeCode }} # add a contract mutation addContract{contactsAdd(request:{ address:{ lineOne: "some place", postalCode: "8888", city: "city", countryCode: "AU" }, contactTypeCode: "P", emailAddress: "test@t.com", name: { first: "test", last: "test", title: "Ms" }, phoneNumbers: { type: Home, number: "23456" } }) { companyName contactTypeCode cultureCode customerNumber distributionOption emailAddress notificationPreference sourceOrganization }} # get current booking query getBooking{booking{ breakdown{balanceDue} currencyCode contacts { key value { companyName contactTypeCode cultureCode customerNumber distributionOption 5/17/2018 [DotRez API] Using GraphQL - NextGen Booking Engine Home - Jetstar Wiki https://jetstar.jira.com/wiki/spaces/NGBE/pages/308510821/DotRez+API+Using+GraphQL 8/16 emailAddress notificationPreference sourceOrganization } } }} # add payment mutation addPayment{paymentAddv2(request:{ amount: 205, currencyCode: "AUD", installments: 1, paymentMethodCode: "MC", paymentFields:[ { key: "ACCTNO", value: "5210000010001001" }, { key: "CC::VerificationCode", value: "555" }, { key: "EXPDATE", value: "08-08-2022" }, { key: "CC::AccountHolderName", value: "abc" } ] }){ payment{ code } }} # post a booking mutation commitBooking{bookingCommit(request:{ latestReceivedBy:"Test", latestReceivedReference:"Test", waiveNameChangeFee:false, waivePenaltyFee:false, distributeToContacts:false, restrictionOverride:false, waiveSpoilageFee:false }){ recordLocator bookingKey 5/17/2018 [DotRez API] Using GraphQL - NextGen Booking Engine Home - Jetstar Wiki https://jetstar.jira.com/wiki/spaces/NGBE/pages/308510821/DotRez+API+Using+GraphQL 9/16 }} # retrieve booking mutation retrieveBooking { bookingRetrieve(request: { recordLocator: "YDZDRF" firstName: "test" lastName: "test" }) { bookingKey currencyCode recordLocator breakdown{balanceDue} journeys{ journeyKey segments{ segmentKey } } passengers{ key value{ name { first last middle suffix title } } } contacts{ key value { companyName contactTypeCode cultureCode customerNumber distributionOption emailAddress notificationPreference sourceOrganization } } } } # query avaliable SSRs 5/17/2018 [DotRez API] Using GraphQL - NextGen Booking Engine Home - Jetstar Wiki https://jetstar.jira.com/wiki/spaces/NGBE/pages/308510821/DotRez+API+Using+GraphQL 10/16 query getSSRs{ssrAvailability(request:{ passengerKeys: ["MCFBRFQ-", "MSFBRFQ-"] currencyCode: "AUD" }){ journeySsrs{ ssrs{available, feeCode, ssrCode, ssrType, passengersAvailability { key value{ ssrKey, passengerKey, price } }} } }} # add baggage mutation addBaggage{ssrsAdd(request:{ currencyCode: "AUD" forceWaveOnSell: false keys: [ { count: 1, ssrKey: "MSFNQ0ZCUkZRLSFYQjI1ISFDR0shM0shNjM2NTE3NDQwMDAwMDAwMDAwIVNJTiEyMDEh }, { count: 1, ssrKey: "MSFNU0ZCUkZRLSFYQjI1ISFDR0shM0shNjM2NTE3NDQwMDAwMDAwMDAwIVNJTiEyMDEh } ] }){ ssrCode, passengerKey, feeCode, count, ssrDetail }} # delete an SSR mutation deleteSS